import React from 'react'
import PortfolioInfo from '../../Info/PortfolioInfo'

const Portfolio = () => {
    return (
        <>
            {PortfolioInfo.map((item, index)=>{
               return(<h1>{item.title}</h1>)
            })}
        </>
    )
}

export default Portfolio
